import React from 'react';

const TestCard = ({test}) => {

    return (
        <div className="col-6">
            <div className="m-2">
                <p>{test?.question}</p>
                <label>
                    {it?.answers?.map( it => {
                            return <input type="radio" name={test?.question} value={it} >{it}</input>
                        }

                    )

                    }
                </label>

            </div>
        </div>
    );
};

export default TestCard;
